import RPi.GPIO as GPIO
import time

GPIO.setmode(GPIO.BCM)

def setup_digital(pin):
    GPIO.setup(pin, GPIO.OUT)

def digital_on(pin):
    print("digital_on", pin)
    GPIO.output(pin, 1)

def digital_off(pin):
    print("digital_off", pin)
    GPIO.output(pin, 0)

def get_digital_staus(pin):
    return GPIO.input(pin)
